import React, { Component } from "react";
import "./NavStyle.css";

class NavBar extends Component {
  constructor(props) {
    super();
  }

  handlePost() {
    console.log("POST {signup data}");
  }

  render() {
    return (
      <nav class="nav-bar">
        IronHack Task List
        <button
          onClick={() => this.handleLogout()}
          style={{ float: "right", margin: "auto" }}
        >
          Logout
        </button>
      </nav>
    );
  }
}

export default NavBar;
